import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 10.1-116 Jurisdiction of conservation officers.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/10.1-116.md","filePath":"vacode/10.1-116.md"}'),o={name:"vacode/10.1-116.md"},n=a('<h1 id="§-10-1-116-jurisdiction-of-conservation-officers" tabindex="-1">§ 10.1-116 Jurisdiction of conservation officers. <a class="header-anchor" href="#§-10-1-116-jurisdiction-of-conservation-officers" aria-label="Permalink to &quot;§ 10.1-116 Jurisdiction of conservation officers.&quot;">​</a></h1><p>Conservation officers shall have jurisdiction throughout the Commonwealth on all Department lands and waters and upon lands and waters under the management or control of the Department, on property of the United States government or a department or agency thereof on which the Commonwealth has concurrent jurisdiction and is contiguous with land of the Department or on which the Department has a management interest, on property operated by the Breaks Interstate Park Commission within the Commonwealth of Virginia with the written agreement of the Commission, on a property of another state agency or department whose property is contiguous with land of the Department, and in those local jurisdictions in which mutual aid agreements have been established pursuant to § <a href="http://law.lis.virginia.gov/vacode/15.2-1736/" target="_blank" rel="noreferrer">15.2-1736</a>.</p><p>Special conservation officers appointed pursuant to § <a href="http://law.lis.virginia.gov/vacode/10.1-115/" target="_blank" rel="noreferrer">10.1-115</a> shall have jurisdiction throughout the Commonwealth.</p><p>1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0205" target="_blank" rel="noreferrer">205</a>; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0087" target="_blank" rel="noreferrer">87</a>; 2015, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0064" target="_blank" rel="noreferrer">64</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0489" target="_blank" rel="noreferrer">489</a>.</p>',4),i=[n];function s(c,h,l,f,p,d){return t(),r("div",null,i)}const u=e(o,[["render",s]]);export{m as __pageData,u as default};
